import React from "react";
import logo from "../../public/content/SVG/Asset 2.svg";
import { motion } from "framer-motion";
import "./Nav.css";
import { BsInstagram, BsTwitter } from "react-icons/bs";
import { IconContext } from "react-icons";

function Nav() {
  return (
    <div className="nav">
      <div className="logo">
        <img src={logo} alt="ABURA-logo" className="logoImg"></img>

        <motion.svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 35.2 39.5"
          className="animate-U"
          initial={{ opacity: 0 }}
          animate={{
            y: -53,
            opacity: 1,
            transition: { type: "spring", duration: 1.6, delay: 0.3 },
          }}
        >
          <path d="m17.6,39.5c10.5,0,17.6-7,17.6-17.6V0h-6.4v22c0,7.2-4.5,11.9-11.2,11.9s-11.2-4.8-11.2-11.9V0H0v21.9c0,10.6,7.1,17.6,17.6,17.6Z" />
        </motion.svg>
      </div>

      <IconContext.Provider value={{ size: 20 }}>
        <ul className="socials">
          <li className="subHeader">A DIASPORA LEGACY</li>
          <motion.li whileHover={{ scale: 1.2 }} className="extra-padding">
            <a
              href="https://www.instagram.com/aburalondon/"
              className="socials-link"
            >
              <BsInstagram />
            </a>
          </motion.li>
          <motion.li whileHover={{ scale: 1.2 }} className="extra-padding">
            <a
              href="https://twitter.com/aburalondon?s=20"
              className="socials-link"
            >
              <BsTwitter />
            </a>
          </motion.li>
        </ul>
      </IconContext.Provider>
    </div>
  );
}

export default Nav;
